import styled from "styled-components";

export const StyleBar = styled.div`
  width: 100%;
  height: 80px;
  background-color: var(--bar);
  display: flex;
  justify-content: space-between;
  color: var(--white);
  align-items: center;
  div {
    display: flex;
    gap: 10px;
    h1 {
      padding: 10px;
      border-left: 1px solid var(--black);
    }
  }
`;
